<script>
import { onMounted } from 'vue'
import { gsap } from 'gsap'
import { ScrollTrigger } from 'gsap/ScrollTrigger'

export default {
  setup () {
    onMounted(() => {
      const Spring = gsap.timeline()
      ScrollTrigger.create({
        animation: Spring,
        trigger: '.scrollElement',
        start: '2% top',
        end: '15% 100%',
        scrub: 2
      })
      gsap.to('#ltree1', { rotate: 1, transformOrigin: 'bottom 150%', delay: 1, duration: 3, ease: 'none', repeat: -1, yoyo: true })
    })
  }
}
</script>

<style scoped>
.spring {
  display: block;
  width: 100%;
  /* height: 100%; */
  position: fixed;
  top: 0;
  left: 0;
  z-index: 2;
}
</style>
